      "description": "<p>Celular Alcatel A1 Libre.</p><br><p>PANTALLA INFINITA, DISEÑO ELEGANTE</p><p>El Alcatel 1 cuenta con un panel de 5 pulgadas y una resolución FWVGA+ (960 x 480 píxeles), muy básica. Sin embargo, sorprende que la compañía haya incluido una relación de aspecto de 18:9. Esto significa que estamos ante una pantalla infinita en la que no hay casi presencia de marcos a ambos lados, lo que siempre es un punto a su favor. A nivel de diseño, el Alcatel 1 sigue la misma línea de otros modelos de la compañía. Cuenta con un chasis de apariencia metalizada en varios colores, con esquinas redondeadas y bastante limpio en su parte trasera. Tan solo encontramos la cámara principal en la parte superior y el logo de Alcatel presidiendo el centro. No hay presencia de lector de huellas dactilares.</p><br><p>UNA CÁMARA CON FUNCIONES DIVERTIDAS</p><p>A nivel de potencia, el Alcatel 1 está alimentado por un procesador de cuatro núcleos. Concretamente, alberga un chip MediaTek 6739, que está acompañado de 1 GB de memoria RAM y de 16 GB de almacenamiento interno. El espacio se puede ampliar sin problemas mediante tarjetas de tipo microSD de hasta 32 GB. Se trata, por tanto, de un conjunto discreto, que únicamente servirá para hacer uso de aplicaciones sencillas, como puede ser Facebook o WhatsApp, navegar por webs o mandar correos y mensajes. Si lo que quieres es jugar a títulos que cuenten con gráficos pesados mejor olvídate de este modelo.</p><br><p>ANDROID GO</p><p>Lo más destacable de este modelo es que llega con Android Oreo Go Edition. Se trata de una versión del sistema creada para que los teléfonos de baja gama puedan trabajar sin problemas y funcionar de forma más fluida. De este modo, gracias a Android Go notaremos que el móvil va rápido. No costará abrir varias aplicaciones sencillas a la vez y podremos tenerlas en segundo plano sin que consuman muchos recursos. Por lo demás, el Alcatel 1 también equipa una batería de 2.000 mAh y las conexiones habituales: WiFi, LTE, GPS, Bluetooth 4.2 y microUSB 2.0.</p><br><p>Accesorios:</p><br><p>*Bateria</p><p>*Cargador de bateria</p><p>*Funda protectora</p><p>*Cable usb</p><p>*Instructivo de uso</p><br>",
