      "name": "Celular Samsung Galaxy A52 128gb + 6gb Ram Liberado",
      "price": 64999,
      "condition": "Nuevo",
      "description": "<p>Pantalla asombrosa, desplazamiento extrafluido</p><p>Disfrutá de los detalles realmente vibrantes con la pantalla Super AMOLED Display FHD+, que alcanza los 800 nits para mayor claridad, incluso con la luz de día brillante. Eye Comfort Shield reduce la luz azul y la pantalla extrafluida mantiene la vista relajada, ya sea que estés jugando o navegando. Todo en la amplia pantalla Infinity-O Display de 6,5 pulgadas.</p><br><p>Cámara asombrosa, siempre nítida y estable</p><p>El sistema de cámaras con múltiples lentes del Galaxy A52 lleva las fotos al siguiente nivel. Conseguí una resolución ultraalta en la cámara principal de 64 MP con OIS para tomar fotos nítidas y claras durante todo el día. Expandí el ángulo de visión con la cámara ultraancha. Personalizá el enfoque con la cámara de profundidad o mirá los detalles de cerca con la cámara macro.</p><br><p>Captura detalles incluso con poca luz gracias a OIS</p><p>Olvidate de las fotos y los videos borrosos. La estabilización óptica de imagen (Optical Image Stabilization, OIS) ayuda a estabilizar tus tomas para mantener el movimiento fluido y las imágenes nítidas, incluso cuando hay poca luz. La cámara capta más luz para mejorar las tomas con poca luz.</p><br><p>Cámara ultraancha, experiencias infinitas</p><p>Al igual que la vista humana, la cámara ultraancha de 12 MP ve el mundo con un ángulo de visión de 123 grados para agregar más perspectiva a todo lo que capturas.</p><br><p>La cámara macro destaca los pequeños detalles</p><p>Acercate a la cámara macro de 5 MP y sacá a relucir los detalles ultrafinos de tus fotos. Aplicá un efecto bokeh natural a tus imágenes para que tu sujeto se destaque del fondo.</p><br><p>Con Super Steady estarás siempre listo</p><p>En el modo Super Steady, el Galaxy A52 mantiene tus videos listos con un aspecto fluido y estable. Graba como una cámara de acción de alta calidad, ya que utiliza la cámara ultraancha y un software predictivo.</p><br><p>Cámara frontal de alta resolución, selfies impresionantes</p><p>La cámara frontal de 32 MP del Galaxy A52 toma selfies claras de alta resolución durante todo el día. Y con el efecto bokeh para difuminar suavemente el fondo, serás la estrella de la foto.</p><br><p>Resistente a derrames y salpicaduras</p><p>Con la clasificación IP67 por su resistencia al agua y al polvo, este teléfono soporta hasta 1,0 metros de agua durante 30 minutos. Así que no te preocupes si tu teléfono se moja un poco y quieres seguir jugando o tomando fotos.</p><br><br><p>Sonido envolvente en la palma de la mano</p><p>Con dos altavoces, uno en la parte superior y otro en la parte inferior, tendrás una experiencia de sonido estéreo sin tener que usar los auriculares. Disfruta una noche de películas o tus juegos favoritos con un sonido cinematográfico que te dejará en medio de la escena.</p><br><p>Batería asombrosa que dura dos día</p><p>Con la batería de 4500 mAh (típico)² tendrás más tiempo para hacer lo que te gusta: transmitir o compartir contenido, jugar y más. La administración de energía de IA detecta y se ajusta a tus hábitos de uso móvil para ofrecerte una energía duradera. Y con una carga superrápida de hasta 25 V, el Galaxy A52 vuelve a su máxima potencia rápidamente.</p><br><p>Rendimiento asombroso para mantenerte el ritmo</p><p>Ya sea que estés enfocado en una tarea o en varias tareas a la vez, el Galaxy A52 ofrece un excelente rendimiento gracias a su procesador avanzado de ocho núcleos y hasta 6 GB de RAM. Almacena más y elimina menos con 128 GB de almacenamiento interno. Y, si no es suficiente, agrega hasta 1 TB con la tarjeta MicroSD.</p><br><p>Game Booster te da ventaja</p><p>Maximiza el rendimiento con Game Booster. Reduce las distracciones y mejora tu juego con una interfaz exclusiva y un menú de fácil acceso. Frame Booster proporciona un movimiento suave y realista de los gráficos. Juega al máximo mientras Game Booster aprende tus patrones de uso para optimizar la batería, la temperatura y la memoria.</p><br><p>Seguro con un simple toque</p><p>El sensor de huella digital en la pantalla del Galaxy A52 reconoce tu huella dactilar para que puedas desbloquear el teléfono de forma sencilla y segura. Además, con los servicios de autenticación biométrica de Samsung Pass, tu huella dactilar proporciona un método de autenticación más rápido y seguro para el inicio de sesión en aplicaciones y sitios web.</p><br><br><p>¿Hacen factura A?</p><p>Para que podamos emitir la factura A, necesitamos que la cuenta de Mercado Libre desde donde vayas a realizar la compra, esté registrada como IVA Responsable Inscripto o IVA Exento. De lo contrario, se va a emitir automáticamente una factura B.</p><p>Podrás actualizar esta información desde la sección \"Mis datos\".</p><br>",
